import React, { useEffect } from 'react';

const ReadData = ({ GHI, fetchGHI, onEdit, onDelete }) => {
  // 데이터 가져오기
  useEffect(() => {
    fetchGHI();
  }, [fetchGHI]);

  return (
    <div>
      {/* 데이터를 리스트 형태로 렌더링 */}
      {GHI.map((item) => (
        <div key={item.id}>
          {`Id: ${item.id}, Country: ${item.country}, Year: ${item.year}, GHI: ${item.ghi}, Stunting: ${item.child_stunting}, Wasting: ${item.child_wasting}, Undernourishment: ${item.undernourishment}, Mortality: ${item.child_mortality}`}
          <br />
          <button onClick={() => onEdit(item)}>Edit</button>
          <button onClick={() => onDelete(item.id)}>Delete</button>
        </div>
      ))}
    </div>
  );
};

export default ReadData;
